create table raffle_tickets
(
    id            int unsigned auto_increment comment '配送包裹ID'
        primary key,
    user_id       int unsigned                       not null comment '奖券归属用户ID',
    ticket_points int unsigned                       not null comment '奖券所含积分点数',
    is_used       tinyint(1)                         not null comment '该奖券是否已被使用',
    ticket_source tinyint                            not null comment '奖券来源，0：购买商品获得、1：未中奖时返还的奖券',
    out_trade_no  varchar(32)                        not null comment '账单编号，购买商品赠送奖券时可用',
    is_enabled    tinyint(1)                         not null comment '该奖券是否被启用',
    created_at    datetime default CURRENT_TIMESTAMP not null,
    updated_at    datetime                           null,
    deleted_at    datetime                           null
)
    collate = utf8mb4_unicode_ci;

create index raffle_tickets_is_enabled_index
    on raffle_tickets (is_enabled);

create index raffle_tickets_is_used_index
    on raffle_tickets (is_used);

create index raffle_tickets_out_trade_no_index
    on raffle_tickets (out_trade_no);

create index raffle_tickets_user_id_index
    on raffle_tickets (user_id);

